func goodSubsetofBinaryMatrix(grid [][]int) []int {
    m := len(grid)
    if m == 0 {
        return []int{}
    }
    n := len(grid[0])
    for subsetSize := 1; subsetSize <= m; subsetSize++ {
        for subset := 0; subset < (1 << m); subset++ {
            if bits.OnesCount(uint(subset)) != subsetSize {
                continue
            }
            sum := make([]int, n)
            valid := true
            rows := []int{}
            for row := 0; row < m; row++ {
                if subset&(1<<row) != 0 {
                    rows = append(rows, row)
                    for col := 0; col < n; col++ {
                        sum[col] += grid[row][col]
                    }
                }
            }
            for _, s := range sum {
                if s*2 > subsetSize {
                    valid = false
                    break
                }
            }
            if valid {
                return rows
            }
        }
    }
    return []int{}
}
